import { useState } from "react"
import { useEffect } from "react"
import { Link } from "react-router-dom"

function Prodacts(){
const [data,setdata]=useState([])
useEffect(()=>{
fetch(" http://localhost:9000/prodact")
.then(res=>res.json())
.then(data=>setdata(data))
},[])
function Delete(Prp){
    return(
fetch(`http://localhost:9000/prodact/${Prp}`,{
    method:"DELELE"
    .then(res=>res.json())
    .then(data=>console.log(data))
})
    )
}
return(
<div className="p-3">

<h1>Prodacts</h1>
<Link to={"/Prodacts/Add"} className="btn btn-success">Add New Prodact</Link>

<table className="table table-striped">
<thead>
<tr>
<th>ID</th>
<th>Title</th>
<th>Price</th>
<th>Operiton</th>
</tr>
</thead>
<tbody>
{data.map((prodact)=>{

return( 
<tr>
<td >{prodact.id}</td>
<td >{prodact.title.slice(0,50)}...</td>
<td>{prodact.price }$</td>
<td>
<button className="btn btn-danger btn-sm" onClick={()=>{Delete(prodact.id)}}>Delete</button>
<Link to={`/Prodacts/${prodact.id}`} className="btn btn-info btn-sm">View</Link>
<button className="btn btn-primary btn-sm">Edit</button>
</td>
</tr>
                        
                    )

            })}
               
            </tbody>
        </table>
        </div>
    )
}
export default Prodacts
